import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Carousel } from "react-bootstrap";
import Scarf1 from "./Assets/scarf1.JPG";
import Scarf2 from "./Assets/scarf2.JPG";
import Scarf3 from "./Assets/scarf3.JPG";

import {Nav, Row, Button} from "react-bootstrap";
import { Link, Route, Router, BrowserRouter } from "react-router-dom";
import Navigation from './Navigation';
function Home() {
  return (
    <div className="home">
    <Navigation/>
   
<Row>
  <div className="innerspace">
    <h1>NatureKnitter</h1>
  </div>
    <Button variant="outline-success" size="lg">
      <b>Customise Products</b>
    </Button>
</Row>

      <div className="caro">
        <Carousel>
          <Carousel.Item>
            <img
              className="scarfa"
              src={Scarf1}
              width={800}
              height={530}
              alt="First slide"
            />
            <Carousel.Caption></Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="scarfb"
              src={Scarf2}
              width={800}
              height={530}
              alt="Second slide"
            />
            <Carousel.Caption></Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="scarfc"
              src={Scarf3}
              width={800}
              height={530}
              alt="Third slide"
            />
            <Carousel.Caption></Carousel.Caption>
          </Carousel.Item>
        </Carousel>
      </div>
    </div>
  );
}

export default Home;
